import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div>
            <a href="https://github.com/WillHofkamp" target="_blank" rel="noopener noreferrer"><i class="fab fa-github"></i></a>
            <a href="https://Instagram.com/WillHofkamp" target="_blank" rel="noopener noreferrer"><i class="fab fa-instagram"></i></a>
            <a href="https://Linkedin.com/in/will-hofkamp-528603186" target="_blank" rel="noopener noreferrer"><i class="fab fa-linkedin-in"></i></a>
            </div>
            )
        }
    }

export default Social
